INSERT INTO `v1_7aa91231e64621454eb26b9af78dd0162f651c31fde6cf772c6f20cab0ae5466` VALUES ("スタンダードコレクション", 1, 1, 3, "1回メダル{0}枚！\n定番グッズであなたの部屋をカルミナで彩ろう！", "スタンダードコレクションではポスターやペナントなど\n部屋に飾れる定番グッズが盛りだくさん！\nあなたの部屋をカルミナで彩ろう！");
INSERT INTO `v1_7aa91231e64621454eb26b9af78dd0162f651c31fde6cf772c6f20cab0ae5466` VALUES ("プレミアムコレクション", 2, 1, 10, "1回メダル{0}枚！\nメンバー直筆サイン色紙など、★★以上のグッズを確定でゲット！", "プレミアムコレクションではサイン色紙や\nブロマイドなど、★★以上のグッズが盛りだくさん！\nレアグッズをたくさんゲットしよう！");
INSERT INTO `v1_7aa91231e64621454eb26b9af78dd0162f651c31fde6cf772c6f20cab0ae5466` VALUES ("フェスコレクション", 3, 1, 3, "1回メダル{0}枚！\nカルミナライブに参加する際のマストアイテムをゲットしよう！", "フェスコレクションではカルミナサマーライブで\n大活躍するグッズが勢ぞろい！\nゲットしたグッズを片手に、いざライブ会場へ！");
